import Page from "./Common_page/Page";
import login_img from "../../../img/login_bg.png";
const Home = () => {
  return (
    <>
      <div className="bg">
        <Page name="Login Page !" />
        <div className="  d-flex justify-content-center align-items-center">
          <div className=" container-fluid">
            <div>
              <div className="row">
                <div className="col-6">
                  <div
                    style={{ backgroundColor: "#D8E1FE", marginTop: "3rem" }}
                  >
                    <div
                      className="login_img"
                      style={{ backgroundImage: `url(${login_img})` }}
                    ></div>
                  </div>
                </div>
                <div className="col-6"></div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Home;
